import axios from 'axios';
import {SET_CATEGORIES} from './'

export const setCategories = (payload) => async({
    type: SET_CATEGORIES,
    payload
})


export const getCategories = () => async dispatch => {
    try {
        const { data } = await axios.get('/spotify/categories');
        console.log(data);
    } catch (error) {
        console.log(error)
    }
}
